import * as React from 'react';
import TextField from '@mui/material/TextField';
import Stack from '@mui/material/Stack';
import { FiSearch } from 'react-icons/fi';
import { Box } from '@mui/system';
import { Typography } from '@mui/material';


export default function FreeSolo() {
  return (
    <Stack spacing={2} sx={{ width: 1000 }}>
      <Box sx={{display:'flex',justifyContent:'center',alignItems:'center'}}>
      <FiSearch size={20} color={'white'}/>
      <TextField
          id="filled-search"
          label="Search destinations, hotelsfield"
          type="search"
          sx={{width:500,'& fieldset':{border:'none'}}}
        />
        <Box sx={{display:'flex'}}>
        <img style={{alignSelf:'center',marginRight:'5px'}} src='./images/Group.svg'/>
        <Typography variant='p' sx={{fontSize: '16px', color:'white'}}>Check in</Typography>
        </Box>
      </Box>

    </Stack>
  );
}
